import React from 'react'

class Codes extends React.Component {
    cppBubbleSort = 'bubblesort';
    cppInsertionSort = 'insertionsort';
    cppMergeSort = 'mergesort';
    cppQuickSort = 'quicksort';
    cppSelectionSort = 'selectionsort';
}

export default Codes
